import React from 'react';
import './home.css';
import imgme from '../../Assets/photoofme.jpeg'

function Home(){
  return (
    <section id="intro">
        <div className="intro_content">
            <span className="name">Rudraksha Singh</span>
            <span className="webd">Web Developer</span>
            <span className="about"><br/>I'm a web developer focused on front-end design <br/> and building clean, responsive interfaces. I also <br/> have knowledge of data structures and algorithms,<br/>  helping me <br/> write efficient code. Check out my work, <br/>—I’d love to connect!</span>
        </div>
        <img src={imgme} alt="Me" className="photoofme" />
    </section>
  )
}

export default Home;
